import Vue from 'vue'
import Router from 'vue-router'
import ListArticle from "./views/ListArticle.vue"
import AddEmployer from "./views/AddEmployer.vue"
import AddApply from "./views/AddApply.vue"
import Login from "./views/login.vue"
import Home from "./views/home.vue"
import ApplyList from "./views/ApplyList.vue"
import Test from "./views/test.vue"
import CheckApply from "./views/ManageApply.vue"
import CheckApplyX from "./views/ManageApplyX.vue"
import EmployeDaKa from "./views/EmployeDaKa.vue"
import AllEmployeState from "./views/AllEmployeState.vue"

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: '登录',
      component: Login
    }, {
      path: '/login',
      name: '登录',
      component: Login,
    },{
      path: '/home',
      name: '',
      component: Home,
    }, {
      path: '/home',
      component: Home,
      name: '管理',
      children: [
        {
          path: '/apply/addApply',
          name: '添加申请',
          component: AddApply,
        }, {
          path: '/employer/AddEmployer',
          name: '添加员工',
          component: AddEmployer,
        }, {
          path: '/blogDetail',
          name: '博客详情',
          component: ListArticle,
        }, {
          path: '/apply/applyList',
          name: '请假记录',
          component: ApplyList,
        }, {
          path: '/test',
          name: '测试',
          component: Test,
        }, {
          path: '/apply/CheckApply',
          name: '审核请假',
          component: CheckApply,
        }, {
          path: '/apply/CheckApplyX',
          name: '审核3天以上请假',
          component: CheckApplyX,
        }, {
          path: '/employer/EmployeDaKa',
          name: '员工打卡',
          component: EmployeDaKa,
        }, {
          path: '/employer/AllEmployeState',
          name: '员工状态',
          component: AllEmployeState,
        }
      ]
    }
  ]
})
